import React from 'react'

import {FormGroup,FormControl,InputLabel, Input,styled,Button} from '@mui/material/';


const Container= styled(FormGroup)`
width:50%;
margin:10% auto 0 auto;
> div{
     margin-top:15px;
    color:#a86b4c;
}
`

function AddUsers() {
  return (
    <>
       <Container>
        <FormControl>
            <InputLabel>Name</InputLabel>
            <Input></Input>
        </FormControl>
        <FormControl>
            <InputLabel>UserName</InputLabel>
            <Input></Input>
        </FormControl>
        <FormControl>
            <InputLabel>Email</InputLabel>
            <Input></Input>
        </FormControl>
        <FormControl>
            <InputLabel>Phone</InputLabel>
            <Input></Input>
        </FormControl>
        <FormControl>
        <Button variant="contained">AddUser</Button> 
        </FormControl>
       </Container>
    </>
  )
}

export default AddUsers;
